import { StyleSheet } from "aphrodite";
const styles = StyleSheet.create({
  info2_mobile_wrapper: {
    paddingLeft: "20px",
    paddingRight: "20px",
    paddingBottom: '30px'
  },
  info2_mobile_h:{
      fontFamily: "SFUIDisplay-Bold",
      fontWeight: 700,
      fontSize: "20px",
      marginBottom: "40px"
  },
  info2_mobile_t:{
    color: "#9f9f9f",
    fontFamily: "SFUIDisplay-Light",
    fontSize: '18px',
    fontWeight: 300,
    lineHeight: '33px',
    marginBottom: '30px'
  },
  info2_mobile_tb:{
      marginBottom: '20px'
  }
});
export default styles;
